import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import LandingPage from "./ui/pages/LandingPage";

const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<LandingPage />} />
      <Route //
        path="/dashboard"
        element={<DashBoarPage />}
      />
    </Routes>
  );
};

function App() {
  return (
    <Router>
      <div className="App">
        <AppRoutes />
      </div>
    </Router>
  );
}

export default App;
